import React from "react";
import styled from "styled-components";
import { Container, SubHeader, SubText } from "../../styledComponents";
import { Avatar } from "@material-ui/core";
import MailIcon from "@material-ui/icons/Mail";

const Overview = () => {
  return (
    <Container flex={1} customStyles={{ paddingTop: 30 }}>
      <Container row center flex={1} customStyles={{ width: "100%" }}>
        <Avatar style={{ backgroundColor: "purple", width: 35, height: 30 }}>
          <MailIcon style={{ fontSize: 18 }} />
        </Avatar>
        <Container
          column
          space="space-around"
          flex={1}
          customStyles={{ width: "100%" }}
        >
          <SubHeader>Latest maintenance issues</SubHeader>
          <SubText>View recent ticket on Barcelona</SubText>
        </Container>
      </Container>
    </Container>
  );
};

export default Overview;
